import React from "react";
import Icon from "../imgs/weather-icons/cloudy.png";

const MainBanner = (props) => {
    console.log(props);
    const [currentDate,currentCity]= props;
    console.log(currentDate, currentCity);
    return (
        <div className="mainBanner">
            <div className="mainBanner-cont--left">
                <h1>{currentCity}</h1>
                <h5>{currentDate}</h5>
                <div>
                    <img src={Icon} />
                </div>
                <h3>Cloudy</h3>
            </div>
            <div className="mainBanner-cont--right">
                <h2>
                    72°
                </h2>
                <p>81°/63°</p>
                <p>Cloudy throughout the day</p>
            </div>
        </div>
    );
};
export default MainBanner;
